#!/usr/bin/env python3
import os, sys, json, base64, tempfile, zipfile, pathlib, struct, shutil, subprocess, platform
from typing import Tuple, Optional
from cryptography.hazmat.primitives.asymmetric import rsa, padding
from cryptography.hazmat.primitives import serialization, hashes
from cryptography.hazmat.primitives.ciphers import Cipher, algorithms, modes

MAGIC = b"ENC1"           # container magic
CHUNK = 1024 * 1024       # 1 MiB io chunks
TAG_LEN = 16              # GCM tag length

BANNER = """
Secure Mini-CLI (STREAMING, zero-storage keys)
1) Generate keypair (display only)
2) Encrypt (uses pubkey.txt if present; otherwise asks) -> <base>.omni
3) Decrypt (uses privkey.txt if present; otherwise asks) -> original name from header
q) Quit
"""

# --------------------- small TUI helpers ---------------------

def clear_screen():
    try:
        sys.stdout.write("\x1b[2J\x1b[H")
        sys.stdout.flush()
    except Exception:
        pass

def pause(msg="Press Enter to return to the main menu..."):
    try:
        input(msg)
    except EOFError:
        pass

def print_header(title=""):
    clear_screen()
    if title:
        print(f"=== {title} ===\n")

def read_stdin_multiline(prompt: str) -> bytes:
    print(prompt)
    print("(Paste PEM, then line with a single '.' to finish)")
    lines = []
    while True:
        try:
            line = input()
        except EOFError:
            break
        if line.strip() == ".":
            break
        lines.append(line)
    return ("\n".join(lines)).encode("utf-8")

# --------------------- RSA / AES helpers ---------------------

def rsa_generate() -> Tuple[bytes, bytes]:
    private_key = rsa.generate_private_key(public_exponent=65537, key_size=4096)
    priv_pem = private_key.private_bytes(
        encoding=serialization.Encoding.PEM,
        format=serialization.PrivateFormat.PKCS8,
        encryption_algorithm=serialization.NoEncryption(),
    )
    pub_pem = private_key.public_key().public_bytes(
        encoding=serialization.Encoding.PEM,
        format=serialization.PublicFormat.SubjectPublicKeyInfo,
    )
    return priv_pem, pub_pem

def rsa_encrypt_key(pub_pem: bytes, key: bytes) -> bytes:
    public_key = serialization.load_pem_public_key(pub_pem)
    return public_key.encrypt(
        key,
        padding.OAEP(
            mgf=padding.MGF1(algorithm=hashes.SHA256()),
            algorithm=hashes.SHA256(),
            label=None,
        ),
    )

def rsa_decrypt_key(priv_pem: bytes, enc_key: bytes) -> bytes:
    private_key = serialization.load_pem_private_key(priv_pem, password=None)
    return private_key.decrypt(
        enc_key,
        padding.OAEP(
            mgf=padding.MGF1(algorithm=hashes.SHA256()),
            algorithm=hashes.SHA256(),
            label=None,  # must match encrypt()
        ),
    )

# --------------------- path handling ---------------------

def resolve_encrypt_input(user_path: str) -> str:
    """
    Accept 'myFile' and try in order:
      1) exact path if exists (file or folder)
      2) '<user_path>.zip'
    """
    p = pathlib.Path(os.path.expanduser(user_path))
    if p.exists():
        return str(p)
    zip_guess = pathlib.Path(str(p) + ".zip")
    if zip_guess.exists():
        return str(zip_guess)
    raise FileNotFoundError(f"Path not found: '{user_path}' (also tried '{user_path}.zip')")

def resolve_decrypt_input(user_path: str) -> str:
    """
    Accept 'myFile' and try:
      1) exact path if exists
      2) '<user_path>.omni'
      3) '<user_path>.enc'
    """
    p = pathlib.Path(os.path.expanduser(user_path))
    if p.exists():
        return str(p)
    omni = pathlib.Path(str(p) + ".omni")
    if omni.exists():
        return str(omni)
    enc = pathlib.Path(str(p) + ".enc")
    if enc.exists():
        return str(enc)
    raise FileNotFoundError(f"Encrypted file not found: '{user_path}' (also tried '.omni' and '.enc')")

def to_omni_path(path: str) -> str:
    """Save beside the source as <base>.omni (base = without final suffix)."""
    p = pathlib.Path(path)
    base = p.with_suffix("")  # strip one suffix
    return str(base) + ".omni"

def zip_path_if_dir(path: str) -> Tuple[str, str, bool, Optional[str]]:
    """
    Returns (source_path_to_encrypt, suggested_name, zipped_bool, temp_zip_path_if_any).
    If path is a directory, creates a temp .zip on disk and returns its path.
    If path is a file, returns the same path.
    Caller must delete temp_zip_path_if_any when done.
    """
    p = pathlib.Path(path)
    if not p.exists():
        raise FileNotFoundError(f"Path does not exist: {path}")
    if p.is_dir():
        fd, tmpzip = tempfile.mkstemp(suffix=".zip")
        os.close(fd)
        tmpzip_path = pathlib.Path(tmpzip)
        try:
            with zipfile.ZipFile(tmpzip_path, "w", zipfile.ZIP_DEFLATED) as zf:
                for root, _, files in os.walk(p):
                    root_path = pathlib.Path(root)
                    for f in files:
                        full = root_path / f
                        arc = str(full.relative_to(p))
                        zf.write(full, arc)
            return str(tmpzip_path), f"{p.name}.zip", True, str(tmpzip_path)
        except Exception:
            try:
                tmpzip_path.unlink()
            except Exception:
                pass
            raise
    else:
        return str(p), p.name, False, None

# --------------------- streaming encrypt/decrypt ---------------------

def encrypt_stream(in_path: str, out_path: str, pub_pem: bytes,
                   suggested_name: str, zipped: bool) -> None:
    key = os.urandom(32)    # AES-256
    nonce = os.urandom(12)  # 96-bit GCM nonce
    enc_key = rsa_encrypt_key(pub_pem, key)

    header = {
        "format": "RSAv2-AES256GCM-STREAM",
        "orig_name": suggested_name,
        "zipped": zipped,
        "nonce": base64.b64encode(nonce).decode("ascii"),
        "enc_key": base64.b64encode(enc_key).decode("ascii"),
        "chunk": CHUNK,
        "tag_len": TAG_LEN,
    }
    hdr_bytes = json.dumps(header, separators=(",", ":")).encode("utf-8")

    cipher = Cipher(algorithms.AES(key), modes.GCM(nonce))
    encryptor = cipher.encryptor()

    with open(in_path, "rb") as fin, open(out_path, "wb") as fout:
        fout.write(MAGIC)
        fout.write(struct.pack(">Q", len(hdr_bytes)))
        fout.write(hdr_bytes)
        while True:
            chunk = fin.read(CHUNK)
            if not chunk:
                break
            ct = encryptor.update(chunk)
            if ct:
                fout.write(ct)
        encryptor.finalize()
        fout.write(encryptor.tag)

def decrypt_stream(enc_path: str, out_path: str, priv_pem: bytes) -> Tuple[bool, str]:
    with open(enc_path, "rb") as fin:
        if fin.read(4) != MAGIC:
            raise ValueError("Not a supported container (bad magic).")
        hdr_len = struct.unpack(">Q", fin.read(8))[0]
        hdr = json.loads(fin.read(hdr_len).decode("utf-8"))
        if hdr.get("format") != "RSAv2-AES256GCM-STREAM":
            raise ValueError("Unsupported format.")

        nonce = base64.b64decode(hdr["nonce"])
        enc_key = base64.b64decode(hdr["enc_key"])
        zipped = bool(hdr.get("zipped", False))
        suggested = hdr.get("orig_name") or "decrypted.bin"

        file_size = os.fstat(fin.fileno()).st_size
        data_start = 12 + hdr_len
        data_end = file_size - TAG_LEN
        if data_end < data_start:
            raise ValueError("Truncated file (no tag or data).")

        fin.seek(file_size - TAG_LEN)
        tag = fin.read(TAG_LEN)

        key = rsa_decrypt_key(priv_pem, enc_key)
        cipher = Cipher(algorithms.AES(key), modes.GCM(nonce, tag))
        decryptor = cipher.decryptor()

        fin.seek(data_start)
        with open(out_path, "wb") as fout:
            remaining = data_end - data_start
            while remaining > 0:
                to_read = CHUNK if remaining >= CHUNK else remaining
                chunk = fin.read(to_read)
                if not chunk:
                    raise ValueError("Unexpected EOF in ciphertext.")
                pt = decryptor.update(chunk)
                if pt:
                    fout.write(pt)
                remaining -= len(chunk)
            decryptor.finalize()

    return zipped, suggested

# --------------------- embedded icon (macOS) ---------------------
# NOTE: You said to omit the Base64 icon blob. Leave EMBEDDED_ICNS_B64 = "".
# If you later paste a base64 .icns, set it below and `fileicon` (brew) will stamp it.

_EMBEDDED_ICNS_PATH = None  # cache temp decoded icns path
EMBEDDED_ICNS_B64 = '''

'''      

def _get_embedded_icns_path() -> Optional[str]:
    global _EMBEDDED_ICNS_PATH
    if _EMBEDDED_ICNS_PATH:
        return _EMBEDDED_ICNS_PATH
    if not EMBEDDED_ICNS_B64:
        return None
    fd, tmp = tempfile.mkstemp(suffix=".icns")
    os.close(fd)
    with open(tmp, "wb") as f:
        f.write(base64.b64decode(EMBEDDED_ICNS_B64))
    _EMBEDDED_ICNS_PATH = tmp
    import atexit
    atexit.register(lambda: os.path.exists(tmp) and os.remove(tmp))
    return _EMBEDDED_ICNS_PATH

def set_custom_icon_if_possible(path_to_file: str):
    import os, platform, shutil, subprocess

    if platform.system() != "Darwin":
        return

    # Prefer an explicit FILEICON path, then common Homebrew locations.
    candidates = []
    env_fileicon = os.environ.get("FILEICON")
    if env_fileicon:
        candidates.append(env_fileicon)
    candidates += [
        "/opt/homebrew/bin/fileicon",   # Apple Silicon Homebrew
        "/usr/local/bin/fileicon",      # Intel Homebrew
        shutil.which("fileicon"),       # whatever PATH provides
    ]

    exe = next((p for p in candidates if p and os.path.exists(p)), None)
    if not exe:
        return  # fileicon isnt installed or not reachable

    icon_path = _get_embedded_icns_path()
    if not icon_path or not os.path.exists(icon_path):
        return

    env = os.environ.copy()
    # Ensure Homebrew dirs are in PATH when launched from a GUI app.
    extra = ["/opt/homebrew/bin", "/usr/local/bin"]
    env["PATH"] = ":".join([env.get("PATH", "")] + extra)

    try:
        subprocess.run(
            [exe, "set", path_to_file, icon_path],
            stdout=subprocess.DEVNULL,
            stderr=subprocess.DEVNULL,
            env=env,
            check=True,
        )
    except Exception:
        pass

# --------------------- shared helpers ---------------------

def _move_if_needed(path: str, dest_dir: Optional[str]) -> str:
    if not dest_dir:
        return path
    dest_dir = os.path.expanduser(dest_dir)
    os.makedirs(dest_dir, exist_ok=True)
    new_path = os.path.join(dest_dir, os.path.basename(path))
    if os.path.abspath(path) != os.path.abspath(new_path):
        shutil.move(path, new_path)
    return new_path

# --------------------- interactive menu actions ---------------------

def do_generate():
    print_header("Generate Keypair")
    priv_pem, pub_pem = rsa_generate()
    print("\n-----BEGIN PRIVATE KEY----- (DO NOT SAVE IF YOU DONT WANT TO) \n")
    print(priv_pem.decode("utf-8").strip())
    print("\n-----BEGIN PUBLIC KEY----- \n")
    print(pub_pem.decode("utf-8").strip())
    print("\n[Done  keep your private key secret.]\n")
    pause()

def _load_key_if_exists(path: pathlib.Path, expected_marker: bytes, label: str) -> Optional[bytes]:
    try:
        if path.exists():
            data = path.read_bytes()
            if expected_marker in data:
                print(f" Loaded {label} from {path}\n")
                return data
            else:
                print(f"  {path} found but not a valid {label}. Asking manually...\n")
    except Exception as e:
        print(f"  Could not read {path}: {e}\n")
    return None

def do_encrypt():
    print_header("Encrypt")
    user_path = input("Path (file OR folder; '.zip' assumed for folders): ").strip()
    try:
        real_src = resolve_encrypt_input(user_path)         # allows 'myFile'  myFile.zip if present
        src_path, suggested_name, zipped, tmp_zip = zip_path_if_dir(real_src)
    except Exception as e:
        print(f"\n {e}\n"); pause(); return

    try:
        print()
        # Try pubkey.txt in CWD first
        pub_pem = _load_key_if_exists(pathlib.Path("pubkey.txt"), b"BEGIN PUBLIC KEY", "PUBLIC KEY")
        if pub_pem is None:
            pub_pem = read_stdin_multiline("Paste PUBLIC KEY (PEM). End with '.' on its own line:")

        print_header("Encrypting")
        if b"BEGIN PUBLIC KEY" not in pub_pem:
            print(" That does not look like a PUBLIC KEY PEM.\n"); pause(); return

        out = to_omni_path(real_src)  # e.g., myFile.zip  myFile.omni  |  folder  folder.omni
        encrypt_stream(src_path, out, pub_pem, suggested_name, zipped)
        set_custom_icon_if_possible(out)

        # If input was a real .zip file (not a temp one), safe-delete after success.
        if tmp_zip is None and pathlib.Path(real_src).is_file() and str(real_src).lower().endswith(".zip") and os.path.exists(out):
            try:
                os.remove(real_src)
                print(f"  Deleted source zip  {real_src}")
            except Exception as e:
                print(f"  Could not delete source zip: {e}")

        print(f" Encrypted  {out}")
        print("   Format: streaming AES-256-GCM + RSA-OAEP(SHA-256). Keys never stored.\n")
    except Exception as e:
        print(f" Encryption failed: {e}\n")
    finally:
        if 'tmp_zip' in locals() and tmp_zip and os.path.exists(tmp_zip):
            try: os.remove(tmp_zip)
            except Exception: pass
    pause()

def do_decrypt():
    print_header("Decrypt")
    user_path = input("Path (base name OK; tries '.omni' then '.enc'): ").strip()
    try:
        enc_path = resolve_decrypt_input(user_path)
    except Exception as e:
        print(f"\n {e}\n"); pause(); return

    print()
    # Try privkey.txt first
    priv_pem = _load_key_if_exists(pathlib.Path("privkey.txt"), b"BEGIN PRIVATE KEY", "PRIVATE KEY")
    if priv_pem is None:
        priv_pem = read_stdin_multiline("Paste PRIVATE KEY (PEM). End with '.' on its own line:")

    print_header("Decrypting")
    if b"BEGIN PRIVATE KEY" not in priv_pem:
        print(" That does not look like a PRIVATE KEY PEM.\n"); pause(); return

    # read header first to get suggested name
    try:
        with open(enc_path, "rb") as fin:
            if fin.read(4) != MAGIC:
                print(" Not a supported container.\n"); pause(); return
            hdr_len = struct.unpack(">Q", fin.read(8))[0]
            hdr = json.loads(fin.read(hdr_len).decode("utf-8"))
            suggested = hdr.get("orig_name", "decrypted.bin")
            zipped = bool(hdr.get("zipped", False))
    except Exception as e:
        print(f" Failed to read header: {e}\n"); pause(); return

    out_dir = os.path.dirname(os.path.abspath(enc_path))
    out_path = os.path.join(out_dir, suggested)

    try:
        zipped_flag, _ = decrypt_stream(enc_path, out_path, priv_pem)
        ok_zip = os.path.exists(out_path)
        if zipped_flag and out_path.endswith(".zip"):
            try:
                with zipfile.ZipFile(out_path, "r") as zf:
                    zf.testzip()
                ok_zip = True
            except Exception:
                ok_zip = False

        print(f" Decrypted  {out_path}")
        if ok_zip:
            try:
                os.remove(enc_path)
                print(f"  Deleted source encrypted file  {enc_path}")
            except Exception as e:
                print(f"  Could not delete encrypted file: {e}")

        if zipped_flag and out_path.endswith(".zip"):
            choice = input("Extract the zip now? [y/N]: ").strip().lower()
            if choice == "y":
                extract_dir = os.path.join(out_dir, suggested[:-4])  # remove .zip
                os.makedirs(extract_dir, exist_ok=True)
                with zipfile.ZipFile(out_path, "r") as zf:
                    zf.extractall(extract_dir)
                print(f" Extracted to: {extract_dir}")
        print()
    except Exception as e:
        print(f" Decryption failed: {e}\n")
    pause()

# --------------------- non-interactive runner (GUI-friendly) ---------------------
# Lets the GUI call the helper like:
#   omni --encrypt SRC --dest DIR --pubkey-file pub.pem --quiet --delete-source
#   omni --decrypt SRC --dest DIR --privkey-file priv.pem --quiet --delete-source

def run_with_args(argv=None) -> int:
    import argparse

    parser = argparse.ArgumentParser(prog="omni", add_help=True)
    mode = parser.add_mutually_exclusive_group(required=True)
    mode.add_argument("--encrypt", action="store_true", help="Encrypt source (file or folder)")
    mode.add_argument("--decrypt", action="store_true", help="Decrypt source (.omni or base name)")
    parser.add_argument("src", help="Source path")
    parser.add_argument("--dest", default=None, help="Destination folder")
    k = parser.add_mutually_exclusive_group()
    k.add_argument("--pubkey-file", dest="pubkey_file", help="PUBLIC key (PEM)")
    k.add_argument("--paste-pubkey", dest="paste_pubkey", action="store_true",
                   help="Read PUBLIC key PEM from stdin")
    k.add_argument("--privkey-file", dest="privkey_file", help="PRIVATE key (PEM)")
    k.add_argument("--paste-privkey", dest="paste_privkey", action="store_true",
                   help="Read PRIVATE key PEM from stdin")
    parser.add_argument("--quiet", action="store_true")
    parser.add_argument("--delete-source", dest="delete_source", action="store_true")
    args = parser.parse_args(argv)

    try:
        if args.encrypt:
            real_src = resolve_encrypt_input(args.src)
            src_path, suggested_name, zipped, tmp_zip = zip_path_if_dir(real_src)

            # key resolution
            if args.paste_pubkey:
                pub_pem = sys.stdin.buffer.read()
            elif args.pubkey_file:
                with open(os.path.expanduser(args.pubkey_file), "rb") as f:
                    pub_pem = f.read()
            else:
                # try local pubkey.txt automatically
                pub_pem = _load_key_if_exists(pathlib.Path("pubkey.txt"), b"BEGIN PUBLIC KEY", "PUBLIC KEY")
                if pub_pem is None:
                    raise ValueError("PUBLIC key not provided. Use --pubkey-file or --paste-pubkey (or place pubkey.txt next to the helper).")

            if b"BEGIN PUBLIC KEY" not in pub_pem:
                raise ValueError("Provided data is not a PUBLIC KEY PEM.")

            # choose output path
            base_out = os.path.basename(to_omni_path(real_src))
            if args.dest:
                os.makedirs(os.path.expanduser(args.dest), exist_ok=True)
                out_path = os.path.join(os.path.expanduser(args.dest), base_out)
            else:
                out_path = to_omni_path(real_src)

            if not args.quiet:
                print("=== Encrypt ===")
                print(f"Source : {real_src}")
                print(f"Output : {out_path}")

            encrypt_stream(src_path, out_path, pub_pem, suggested_name, zipped)
            set_custom_icon_if_possible(out_path)

            # optional delete of original .zip if input was a real .zip (not temp)
            if args.delete_source and tmp_zip is None:
                if pathlib.Path(real_src).is_file() and str(real_src).lower().endswith(".zip"):
                    try: os.remove(real_src)
                    except Exception as e:
                        if not args.quiet: print(f"Could not delete source zip: {e}", file=sys.stderr)

            # clean temp zip
            if tmp_zip and os.path.exists(tmp_zip):
                try: os.remove(tmp_zip)
                except Exception: pass

            return 0

        else:  # --decrypt
            enc_path = resolve_decrypt_input(args.src)

            # key resolution
            if args.paste_privkey:
                priv_pem = sys.stdin.buffer.read()
            elif args.privkey_file:
                with open(os.path.expanduser(args.privkey_file), "rb") as f:
                    priv_pem = f.read()
            else:
                # try local privkey.txt automatically
                priv_pem = _load_key_if_exists(pathlib.Path("privkey.txt"), b"BEGIN PRIVATE KEY", "PRIVATE KEY")
                if priv_pem is None:
                    raise ValueError("PRIVATE key not provided. Use --privkey-file or --paste-privkey (or place privkey.txt next to the helper).")

            if b"BEGIN PRIVATE KEY" not in priv_pem:
                raise ValueError("Provided data is not a PRIVATE KEY PEM.")

            # peek header for suggested name
            with open(enc_path, "rb") as fin:
                if fin.read(4) != MAGIC:
                    raise ValueError("Not a supported container (magic).")
                hdr_len = struct.unpack(">Q", fin.read(8))[0]
                hdr = json.loads(fin.read(hdr_len).decode("utf-8"))
                suggested = hdr.get("orig_name", "decrypted.bin")

            out_dir = os.path.expanduser(args.dest) if args.dest else os.path.dirname(os.path.abspath(enc_path))
            os.makedirs(out_dir, exist_ok=True)
            out_path = os.path.join(out_dir, suggested)

            if not args.quiet:
                print("=== Decrypt ===")
                print(f"Source : {enc_path}")
                print(f"Output : {out_path}")

            decrypt_stream(enc_path, out_path, priv_pem)

            if args.delete_source and os.path.exists(out_path):
                try: os.remove(enc_path)
                except Exception as e:
                    if not args.quiet: print(f"Could not delete encrypted file: {e}", file=sys.stderr)

            return 0

    except Exception as e:
        print(f"{type(e).__name__}: {e}", file=sys.stderr)
        return 1

# --------------------- interactive main ---------------------

def main():
    while True:
        print_header("Secure Mini-CLI")
        print(BANNER)
        choice = input("Select: ").strip().lower()
        if choice == "1":
            do_generate()
        elif choice == "2":
            do_encrypt()
        elif choice == "3":
            do_decrypt()
        elif choice in ("q", "quit", "exit"):
            print("\nBye.\n")
            return
        else:
            print("\nInvalid selection.\n")
            pause()

if __name__ == "__main__":
    if any(a.startswith("--") for a in sys.argv[1:]):
        sys.exit(run_with_args(sys.argv[1:]))
    else:
        try:
            main()
        except KeyboardInterrupt:
            print("\nInterrupted.")